"use strict";(self.webpackChunkblogsaurus=self.webpackChunkblogsaurus||[]).push([[1477],{10:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"Overloading and Overriding","metadata":{"permalink":"/blog/Overloading and Overriding","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-09-16-over/index.md","source":"@site/blog/2023-09-16-over/index.md","title":"Overloading & Overriding","description":"\uc624\ubc84\ub85c\ub529\uacfc \uc624\ubc84\ub77c\uc774\ub529\uc5d0 \ub300\ud574\uc11c \uc54c\uc544\ubcf4\uaca0\uc2b5\ub2c8\ub2e4.","date":"2023-09-16T00:00:00.000Z","formattedDate":"September 16, 2023","tags":[{"label":"Overriding","permalink":"/blog/tags/overriding"},{"label":"Overloading","permalink":"/blog/tags/overloading"},{"label":"\uc624\ubc84\ub85c\ub529","permalink":"/blog/tags/\uc624\ubc84\ub85c\ub529"},{"label":"\uc624\ubc84\ub77c\uc774\ub529","permalink":"/blog/tags/\uc624\ubc84\ub77c\uc774\ub529"}],"readingTime":3.87,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"Overloading and Overriding","title":"Overloading & Overriding","authors":["kihyun"],"tags":["Overriding","Overloading","\uc624\ubc84\ub85c\ub529","\uc624\ubc84\ub77c\uc774\ub529"]},"nextItem":{"title":"[SOLID] \uac1d\uccb4 \uc9c0\ud5a5 \ud504\ub85c\uadf8\ub798\ubc0d(OOP) \uc6d0\uce59","permalink":"/blog/design pattern rule"}},"content":"\uc624\ubc84\ub85c\ub529\uacfc \uc624\ubc84\ub77c\uc774\ub529\uc5d0 \ub300\ud574\uc11c \uc54c\uc544\ubcf4\uaca0\uc2b5\ub2c8\ub2e4.\\n\\n## \uc624\ubc84\ub85c\ub529 (Overloading)\\n\\n### \uc815\uc758\\n\\n\ud55c \ud074\ub798\uc2a4 \ub0b4\uc5d0 \uc774\ubbf8 **\uc0ac\uc6a9\ud558\ub824\ub294 \uc774\ub984**\uacfc **\uac19\uc740 \uc774\ub984**\uc744 \uac00\uc9c4 **`\uba54\uc18c\ub4dc`**\uac00 \uc788\uc5b4\ub3c4 \ub9e4\uac1c \ubcc0\uc218\uc758 \uac1c\uc218\uc640 \ud0c0\uc785\uc774 \ub2e4\ub974\uba74 \uac19\uc740 \uc774\ub984\uc744 \uc0ac\uc6a9\ud574\uc11c \uba54\uc18c\ub4dc\ub97c \uc7ac\uc815\uc758 \ud560 \uc218 \uc788\ub2e4.\\n\\n\uc5ec\uae30\uc11c \ud575\uc2ec\uc740 2\uac00\uc9c0\ub85c \uc815\ub9ac\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n1. \uba54\uc18c\ub4dc\uc758 \uc774\ub984\uc774 \uac19\ub2e4.\\n2. \ub9e4\uac1c\ubcc0\uc218\uc758 \uac1c\uc218\ub098 \ud0c0\uc785\uc774 \ub2ec\ub77c\uc57c \ud55c\ub2e4.\\n3. \ub9ac\ud134\uac12\uacfc\ub294 \uc0c1\uad00 \uc5c6\uc2b5\ub2c8\ub2e4.\\n\\n\\n### \uc624\ubc84\ub85c\ub529 \ud568\uc218 \ucf54\ub4dc\\n\\n```java title=\'\uc624\ubc84\ub85c\ub529 \ud568\uc218\'\\npublic class OverringClass {\\n    \\n    // \uc624\ubc84\ub85c\ub529 1\ubc88 \ud568\uc218\\n    public void OverloadMethod(){\\n        System.out.println(\\"============================\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \uc218 : 0\uac1c\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : void\\");\\n        System.out.println(\\"\uc624\ubc84\ub77c\uc774\ub529 1\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4.\\");\\n        System.out.println(\\"============================\\");\\n    }\\n\\n    // \uc624\ubc84\ub85c\ub529 2\ubc88 \ud568\uc218\\n    public int OverloadMethod(int a, int b){\\n        System.out.println(\\"============================\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \uc218 : 2\uac1c\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : int\\");\\n        System.out.println(\\"\uc624\ubc84\ub77c\uc774\ub529 2\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \ub367\uc148 \uac12\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.\\");\\n        System.out.println(\\"============================\\");\\n\\n        return a+b;\\n    }\\n\\n    // \uc624\ubc84\ub85c\ub529 3\ubc88 \ud568\uc218\\n    public int OverloadMethod(int a, int b, int c){\\n        System.out.println(\\"============================\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \uc218 : 3\uac1c\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : int\\");\\n        System.out.println(\\"\uc624\ubc84\ub77c\uc774\ub529 3\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \uacf1\uc148\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.\\");\\n        System.out.println(\\"============================\\");\\n\\n        return a*b*c;\\n    }\\n\\n\\n    // \uc624\ubc84\ub85c\ub529 4\ubc88 \ud568\uc218\\n    public boolean OverloadMethod(String str){\\n        System.out.println(\\"============================\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \uc218 : 1\uac1c\\");\\n        System.out.println(\\"\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : String\\");\\n        System.out.println(\\"\uc624\ubc84\ub77c\uc774\ub529 4\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \uc774\ub984\uc774 park\uc774\uba74 true\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4.\\");\\n        System.out.println(\\"============================\\");\\n\\n        if(str.equals(\\"park\\")){\\n            return true;\\n        }else{\\n            return false;\\n        }\\n    }\\n}\\n\\n```\\n\\n\uc704 \ud568\uc218\ub4e4\uc744 \ubcf4\uc2dc\uba74 `OverloadMethod`\ub85c \uc774\ub984\ub4e4\uc774 \uac19\uc9c0\ub9cc \ud0c0\uc785\uacfc \ub9e4\uac1c\ubcc0\uc218\uc758 \uc218\uac00 \ub2e4\ub978 \uac83\ub4e4\uc744 \ubcf4\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ud568\uc218\ub4e4\uc5d0 \ub300\ud55c \uc124\uba85\uc740 \ucf54\ub4dc\uc5d0 \uc791\uc131\ub3fc \uc788\uc73c\ub2c8 \ucc38\uace0\ud574\uc8fc\uc138\uc694~ \ud83d\ude0e\\n\\n\ucf54\ub4dc\ub97c \uc2e4\ud589\ud558\ub294 \ucf54\ub4dc\uc640 \uacb0\uacfc\ub97c \ud655\uc778\ud574\ubcf4\uaca0\uc2b5\ub2c8\ub2e4.\\n\\n``` java title=\'\uacb0\uacfc \ud655\uc778 \ucf54\ub4dc\'\\npublic class Main {\\n    public static void main(String[] args) {\\n        OverringClass oc = new OverringClass();\\n        \\n        // \uc624\ubc84\ub85c\ub529 1\ubc88 \ud568\uc218\\n        oc.OverloadMethod();\\n\\n        // \uc624\ubc84\ub85c\ub529 2\ubc88 \ud568\uc218\\n        int a = oc.OverloadMethod(1,2);\\n        System.out.println(\\"\uc624\ubc84\ub85c\ub529 2\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : \\"+a);\\n\\n        // \uc624\ubc84\ub85c\ub529 3\ubc88 \ud568\uc218\\n        int b = oc.OverloadMethod(4,5,6);\\n        System.out.println(\\"\uc624\ubc84\ub85c\ub529 3\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : \\"+b);\\n\\n        // \uc624\ubc84\ub85c\ub529 4\ubc88 \ud568\uc218\\n        boolean c = oc.OverloadMethod(\\"park\\");\\n        System.out.println(\\"\uc624\ubc84\ub85c\ub529 4\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : \\"+c);\\n    }\\n}\\n```\\n\\n```text title=\'\uacb0\uacfc\'\\n============================\\n\ub9e4\uac1c\ubcc0\uc218 \uc218 : 0\uac1c\\n\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : void\\n\uc624\ubc84\ub77c\uc774\ub529 1\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4.\\n============================\\n============================\\n\ub9e4\uac1c\ubcc0\uc218 \uc218 : 2\uac1c\\n\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : int\\n\uc624\ubc84\ub77c\uc774\ub529 2\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \ub367\uc148 \uac12\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.\\n============================\\n\uc624\ubc84\ub85c\ub529 2\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : 3\\n============================\\n\ub9e4\uac1c\ubcc0\uc218 \uc218 : 3\uac1c\\n\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : int\\n\uc624\ubc84\ub77c\uc774\ub529 3\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \uacf1\uc148\uc744 \ubc18\ud658\ud569\ub2c8\ub2e4.\\n============================\\n\uc624\ubc84\ub85c\ub529 3\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : 120\\n============================\\n\ub9e4\uac1c\ubcc0\uc218 \uc218 : 1\uac1c\\n\ub9e4\uac1c\ubcc0\uc218 \ud0c0\uc785 : String\\n\uc624\ubc84\ub77c\uc774\ub529 4\ubc88 \ud568\uc218 \uc785\ub2c8\ub2e4. \uc774\ub984\uc774 park\uc774\uba74 true\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4.\\n============================\\n\uc624\ubc84\ub85c\ub529 4\ubc88 \ud568\uc218 \ubc18\ud658\uac12 : true\\n```"},{"id":"design pattern rule","metadata":{"permalink":"/blog/design pattern rule","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-08-29-rule/index.md","source":"@site/blog/2023-08-29-rule/index.md","title":"[SOLID] \uac1d\uccb4 \uc9c0\ud5a5 \ud504\ub85c\uadf8\ub798\ubc0d(OOP) \uc6d0\uce59","description":"SRP ( \ub2e8\uc77c \ucc45\uc784\uc758 \uc6d0\uce59 : Single Responsibility Principle )","date":"2023-08-29T00:00:00.000Z","formattedDate":"August 29, 2023","tags":[{"label":"design pattern","permalink":"/blog/tags/design-pattern"},{"label":"rule","permalink":"/blog/tags/rule"}],"readingTime":1.925,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"design pattern rule","title":"[SOLID] \uac1d\uccb4 \uc9c0\ud5a5 \ud504\ub85c\uadf8\ub798\ubc0d(OOP) \uc6d0\uce59","authors":["kihyun"],"tags":["design pattern","rule"]},"prevItem":{"title":"Overloading & Overriding","permalink":"/blog/Overloading and Overriding"},"nextItem":{"title":"\uc804\ub7b5 \ud328\ud134 - Strategy pattern","permalink":"/blog/strategy pattern"}},"content":"## SRP ( \ub2e8\uc77c \ucc45\uc784\uc758 \uc6d0\uce59 : Single Responsibility Principle )\\n\\n## OCP ( \uacc4\ubc29-\ud3d0\uc1c4\uc758 \uc6d0\uce59 : Open Close Principle )\\n\\n1. \ubc14\ub00c\ub294 \ubd80\ubd84\uc744 \ucea1\uc290\ud654\ud55c\ub2e4.\\n    - \ubcc0\ud558\ub294(\ud655\uc7a5\ub418\ub294) \uac83\uacfc \ubcc0\ud558\uc9c0 \uc54a\uc744 \uac83\uc744 \uad6c\ubd84\\n\\n2. \uc0c1\uc18d\ubcf4\ub2e4\ub294 \uad6c\uc131\uc744 \ud65c\uc6a9\ud55c\ub2e4.\\n\\n3. \uad6c\ud604\ubcf4\ub2e4\ub294 \uc778\ud130\ud398\uc774\uc2a4\uc5d0 \ub9de\ucdb0\uc11c \ud504\ub85c\uadf8\ub798\ubc0d\ud55c\ub2e4.\\n    - \uc815\uc758\ud55c \uc778\ud130\ud398\uc774\uc2a4\uc5d0 \uc758\uc874\\n\\n4. \uc0c1\ud638\uc791\uc6a9\ud558\ub294 \uac1d\uccb4 \uc0ac\uc774\uc5d0\uc11c\ub294 \uac00\ub2a5\ud558\uba74 \ub290\uc2a8\ud55c \uacb0\ud569\uc744 \uc0ac\uc6a9\ud574\uc57c \ud55c\ub2e4.\\n\\n5. \ud074\ub798\uc2a4\ub294 \ud655\uc7a5\uc5d0\ub294 \uc5f4\ub824\uc788\uc5b4\uc57c \ud558\uace0 \ubcc0\uacbd\uc5d0\ub294 \ub2eb\ud600 \uc788\uc5b4\uc57c \ud55c\ub2e4.\\n\\n## LSP ( \ub9ac\uc2a4\ucf54\ud504 \uce58\ud658\uc758 \uc6d0\uce59 : The LisKov Substitution Principle )\\n\\n## ISP ( \uc778\ud130\ud398\uc774\uc2a4 \ubd84\ub9ac\uc758 \uc6d0\uce59 : Interface Segregation Principle )\\n\\n## DIP ( \uc758\uc874\uc131 \uc5ed\uc804\uc758 \uc6d0\uce59 : Dependency Inversion Principle )\\n\\n1. \ucd94\uc0c1\ud654\ub41c \uac83\uc5d0 \uc758\uc874\ud558\uac8c \ub9cc\ub4e4\uace0 \uad6c\uc0c1 \ud074\ub798\uc2a4\uc5d0 \uc758\uc874\ud558\uc9c0 \uc54a\uac8c \ub9cc\ub4e0\ub2e4.\\n\\n2. \uace0\uc218\uc900 \uad6c\uc131 \uc694\uc18c\uac00 \uc800\uc218\uc900 \uad6c\uc131 \uc694\uc18c\uc5d0 \uc758\uc874\ud558\uba74 \uc548\ub418\uace0 \ud56d\uc0c1 \ucd94\uc0c1\ud654\uc5d0 \uc758\uc874\ud558\uac8c \ub9cc\ub4e4\uc5b4\uc57c \ud55c\ub2e4.\\n`\uace0\uc218\uc900 \uad6c\uc131 \uc694\uc18c` : \ub2e4\ub978 `\uc800\uc218\uc900 \uad6c\uc131 \uc694\uc18c`\uc5d0 \uc758\ud574 \uc815\uc758\ub418\ub294 \ud589\ub3d9\uc774 \ub4e4\uc5b4\uc788\ub294 \uad6c\uc131 \uc694\uc18c\\n\\n3. \ubcc0\uc218\uc5d0 \uad6c\uc0c1 \ud074\ub798\uc2a4\uc758 \ub808\ud37c\ub7f0\uc2a4\ub97c \uc800\uc7a5\ud558\uc9c0 \uc54a\ub294\ub2e4.\\n\\n4. \uad6c\uc0c1 \ud074\ub798\uc2a4\uc5d0\uc11c \uc720\ub3c4\ub41c \ud074\ub798\uc2a4\ub97c \ub9cc\ub4e4\uc9c0 \uc54a\ub294\ub2e4.\\n\\n5. \ubca0\uc774\uc2a4 \ud074\ub798\uc2a4\uc5d0 \uc774\ubbf8 \uad6c\ud604\ub418\uc5b4 \uc788\ub294 \uba54\uc18c\ub4dc\ub97c \uc624\ubc84\ub77c\uc774\ub4dc\ud558\uc9c0 \uc54a\ub294\ub2e4."},{"id":"strategy pattern","metadata":{"permalink":"/blog/strategy pattern","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-08-29-stratgy/index.md","source":"@site/blog/2023-08-29-stratgy/index.md","title":"\uc804\ub7b5 \ud328\ud134 - Strategy pattern","description":"\uc815\uc758","date":"2023-08-29T00:00:00.000Z","formattedDate":"August 29, 2023","tags":[{"label":"design pattern","permalink":"/blog/tags/design-pattern"},{"label":"strategy pattern","permalink":"/blog/tags/strategy-pattern"}],"readingTime":1.465,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"strategy pattern","title":"\uc804\ub7b5 \ud328\ud134 - Strategy pattern","authors":["kihyun"],"tags":["design pattern","strategy pattern"]},"prevItem":{"title":"[SOLID] \uac1d\uccb4 \uc9c0\ud5a5 \ud504\ub85c\uadf8\ub798\ubc0d(OOP) \uc6d0\uce59","permalink":"/blog/design pattern rule"},"nextItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"## \uc815\uc758\\n\\n\uc54c\uace0\ub9ac\uc998\uad70\uc744 \uc815\uc758\ud558\uace0 \ucea1\uc290\ud654\ud574\uc11c \uac01\uac01\uc758 \uc54c\uace0\ub9ac\uc998\uad70\uc744 \uc218\uc815\ud574\uc11c \uc4f8 \uc218 \uc788\uac8c \ud574\uc900\ub2e4.\\n\uc804\ub7b5 \ud328\ud134\uc744 \uc0ac\uc6a9\ud558\uba74 \ud074\ub77c\uc774\uc5b8\ud2b8\ub85c\ubd80\ud130 \uc54c\uace0\ub9ac\uc998\uc744 \ubd84\ub9ac\ud574\uc11c \ub3c5\ub9bd\uc801\uc73c\ub85c \ubcc0\uacbd\ud560 \uc218 \uc788\ub2e4.\\n\\n## \ud2b9\uc9d5\\n\\n- \ud568\uc218 \uc911 \ubcc0\ud558\ub294 \ucf54\ub4dc\ub97c class\ub85c \uad6c\ud604\ud558\uc5ec \uc0c1\uc18d\ubc1b\ub294 \uac83\uc774 \uc544\ub2cc interface\ub85c \uad6c\ud604\ud558\uc5ec\uc11c Composition\ud558\ub294\uac8c \uc88b\ub2e4.\\n\\n## \uc608\uc2dc\\n\\n```java title=\\"/src/interfaces/FlyBehavior.java\\"\\npublic interface FlyBehavor {\\n    public void fly();\\n}\\n```\\n\uc704 \ucc98\ub7fc \ub098\ub294 \ud589\ub3d9 \uc778\ud130\ud398\uc774\uc2a4\ub97c \uad6c\ud604\ud558\uace0\\n\\n```java title=\\"/src/classes/Duck.java\\"\\npublic abstract class Duck {\\n    FlyBehavor flyBehavor;\\n\\n    public void setFlyBehavor(FlyBehavor flyBehavor) {\\n        this.flyBehavor = flyBehavor;\\n    }\\n}\\n```\\n\ucd94\uc0c1 \ud074\ub798\uc2a4\uc5d0\uc120 interface \uc120\uc5b8 \ubc0f setter\ub97c \uad6c\ud604\ud558\uace0\\n\\n```java title=\\"/src/classes/FlyNoway ... FlyWithWings.java\\"\\npublic class FlyNoWay implements FlyBehavor {\\n    @Override\\n    public void fly() {\\n        System.out.println(\\"I can\'t fly ! TT\\");\\n    }\\n}\\n\\npublic class FlyRocketPowered implements FlyBehavor {\\n    @Override\\n    public void fly() {\\n        System.out.println(\\"ROCKET FLY!!\\");\\n    }\\n}\\n\\npublic class FlyWithWings implements FlyBehavor {\\n    @Override\\n    public void fly() {\\n        System.out.println(\\"I can fly!!\\");\\n    }\\n}\\n```\\n\\n\uc704 \ucf54\ub4dc\ub4e4\ucc98\ub7fc interface\ub97c \uad6c\ud604\ud558\uc5ec\uc11c \uc624\ubc84\ub77c\uc774\ub529\uc744 \ud569\ub2c8\ub2e4.\\n\\n```java title=\\"/src/classes/MallardDuck.java\\"\\npublic class MallardDuck extends Duck{\\n    public MallardDuck(){\\n        flyBehavor = new FlyWithWings();\\n    }\\n}\\n```\\n\uc0dd\uc131\uc790\uc5d0\uc11c \uc0c8\ub85c \uad6c\ud604\ud55c \uc778\ud130\ud398\uc774\uc2a4\ub85c \uc0dd\uc131\ud569\ub2c8\ub2e4."},{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/kihyun1998/blogsaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-08-29-welcome/index.md","source":"@site/blog/2023-08-29-welcome/index.md","title":"Welcome","description":"Docusaurus \uccab\ubc88\uc9f8 \uae00\uc774\ub2e4.","date":"2023-08-29T00:00:00.000Z","formattedDate":"August 29, 2023","tags":[{"label":"docusaurus","permalink":"/blog/tags/docusaurus"},{"label":"first post","permalink":"/blog/tags/first-post"}],"readingTime":0.095,"hasTruncateMarker":false,"authors":[{"name":"Park Ki Hyun","title":"Deveploper","url":"https://github.com/kihyun1998","imageURL":"https://github.com/kihyun1998.png","key":"kihyun"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["kihyun"],"tags":["docusaurus","first post"]},"prevItem":{"title":"\uc804\ub7b5 \ud328\ud134 - Strategy pattern","permalink":"/blog/strategy pattern"}},"content":"Docusaurus \uccab\ubc88\uc9f8 \uae00\uc774\ub2e4.\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)\\n\\n\uadc0\uc5ec\uc6b4 \uacf5\ub8e1 \uc778\ud615\uc774 \uc788\ub2e4."}]}')}}]);